 element with text '%@' in %d seconds\", TEXT_TO_LOOK_FOR, TIMEOUT_SECONDS);\n}\n\n\n@end\n","colorizedLines":null,"stylingDirectives":[[{"start":1,"end":7,"cssClass":"pl-k"},{"start":8,"end":23,"cssClass":"pl-s"},{"start":8,"end":9,"cssClass":"pl-pds"},{"start":22,"end":23,"cssClass":"pl-pds"}],[{"start":1,"end":7,"cssClass":"pl-k"},{"start":8,"end":25,"cssClass":"pl-s"},{"start":8,"end":9,"cssClass":"pl-pds"},{"start":24,"end":25,"cssClass":"pl-pds"}],[],[{"start":1,"end":7,"cssClass":"pl-k"},{"start":8,"end":24,"cssClass":"pl-s"},{"start":8,"end":9,"cssClass":"pl-pds"},{"start":23,"end":24,"cssClass":"pl-pds"}],[{"start":1,"end":7,"cssClass":"pl-k"},{"start":8,"end":29,"cssClass":"pl-s"},{"start":8,"end":9,"cssClass":"pl-pds"},{"start":28,"end":29,"cssClass":"pl-pds"}],[],[{"start":1,"end":7,"cssClass":"pl-k"},{"start":8,"end":23,"cssClass":"pl-en"},{"start":24,"end":27,"cssClass":"pl-c1"}],[{"start":1,"end":7,"cssClass":"pl-k"},{"start":8,"end":24,"cssClass":"pl-en"},{"start":25,"end":44,"cssClass":"pl-s"},{"start":25,"end":27,"cssClass":"pl-pds"},{"start":43,"end":44,"cssClass":"pl-pds"}],[],[{"start":0,"end":10,"cssClass":"pl-k"},{"start":11,"end":22,"cssClass":"pl-en"},{"start":25,"end":35,"cssClass":"pl-e"}],[],[{"start":0,"end":4,"cssClass":"pl-k"}],[],[{"start":0,"end":15,"cssClass":"pl-k"},{"start":16,"end":27,"cssClass":"pl-en"}],[],[{"start":3,"end":7,"cssClass":"pl-c1"},{"start":8,"end":25,"cssClass":"pl-en"},{"start":25,"end":26,"cssClass":"pl-en"},{"start":36,"end":40,"cssClass":"pl-smi"},{"start":41,"end":49,"cssClass":"pl-en"},{"start":49,"end":50,"cssClass":"pl-en"},{"start":51,"end":55,"cssClass":"pl-c1"},{"start":73,"end":77,"cssClass":"pl-en"}],[],[{"start":2,"end":4,"cssClass":"pl-k"},{"start":6,"end":10,"cssClass":"pl-c1"}],[{"start":4,"end":10,"cssClass":"pl-k"},{"start":11,"end":14,"cssClass":"pl-c1"}],[],[{"start":2,"end":5,"cssClass":"pl-k"},{"start":32,"end":40,"cssClass":"pl-c1"}],[{"start":4,"end":6,"cssClass":"pl-k"},{"start":9,"end":